import React, { useState } from 'react'
import Input from './Input';


function FormLogin(props) {




    return (
        <div  style={{ width:400, margin:'auto'}}>
            <form>
               <Input type='text' placeholder='Username'/>  
               <Input type='password' />
               <Input type='email' /> 

                <input type="submit" />
            </form>


        </div>
    );
}

export default FormLogin
